import React, { useState } from 'react'
import ProjectCard from './ProjectCard'

function Projects(projects, addProjectsToState) {

  const projectComponents = projects.map((eachProject) => {
    return (
      <ProjectCard 
      key = {eachProject.id}
      {...eachProject}
    />)
  })

  function handleAddProject (newDogPark) {

    fetch('/dogparks', {
      method: 'POST',
      body: newDogPark
    })
    .then(r=>r.ok ?
      r.json().then(data => addDogParkToState(data)) :
      alert('Please enter a valid url!')
    )

 }
  return (
    <div>
      <h1>Projects</h1>
      <div>{projectComponents}</div>
    </div>
  )
}

export default Projects
